	getPhotoByBase64 () {
		let url = 'https://www.femock.com/api/mock/201819/getPhotoListBase64';
		http.get(url, {}).then(res => {
			if (res.data) {
				this.setData({
					imgList: res.data
				});
			}
			this.drawImg(res.data[0].avatarBase64);
		});
	},
